import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {BrowserRouter} from 'react-router-dom'
import Movies from './components/AnimeHouse'
ReactDOM.render(
  <BrowserRouter>
    <Route path="/" component={Movies}/>
  <App />
</BrowserRouter>,
  document.getElementById('root')
);
